using FoodMenuApp.Models;
using Microsoft.EntityFrameworkCore;

namespace FoodMenuApp.Data
{
    public class MenuContext : DbContext
    {
        public MenuContext(DbContextOptions<MenuContext> contextOptions) : base(contextOptions)
        {
            
        }
        protected override void OnModelCreating(ModelBuilder modelBuilder)
        {
            modelBuilder.Entity<DishIngredient>().HasKey(di => new { 
                di.DishId,
                di.IngredientId
            });

            modelBuilder.Entity<DishIngredient>().HasOne(di => di.Dish)
                .WithMany(di => di.DishIngredients)
                .HasForeignKey(di => di.DishId);

            modelBuilder.Entity<DishIngredient>().HasOne(i => i.Ingredient)
                .WithMany(di => di.DishIngredients)
                .HasForeignKey(i => i.IngredientId);

            modelBuilder.Entity<Dish>().HasData(new Dish
            { 
                Id = 1, Name ="Chicken", Price=7.80,
                ImageUrl = "data:image/jpeg;base64,"
            });

            modelBuilder.Entity<Ingredient>().HasData(
                new Ingredient 
                {
                    Id = 1,
                    Name = "Tomato Sauce"
                },
                 new Ingredient
                 {
                     Id = 2,
                     Name = "Chicken"
                 });

            modelBuilder.Entity<DishIngredient>().HasData(
                new DishIngredient { DishId = 1, IngredientId = 1},
                new DishIngredient { DishId = 1, IngredientId = 2}
                );

            base.OnModelCreating(modelBuilder);
        }

        public DbSet<Dish> Dishes { get; set; }
        public DbSet<Ingredient> Ingredients { get; set; }
        public DbSet<DishIngredient> DishIngredients { get; set; }
    }
}
